import {HashRouter as Router, Route} from 'react-router-dom';
import './App.css';

import Soup from './Soup/Soup';
import Find from './Find/Find';
import DomParser from './DomParser/DomParser';

function App() {
  return (
    <div className="App">
      <Router>     
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/Find">
          <Find />
        </Route>
        <Route path="/DomParse">
          <DomParser />
        </Route>
        <Route path="/Soup">
          <Soup />
        </Route>
      </Router>
    </div>
  );
}


export default App;
